import React from 'react';
import {ListGroup, Row, Col} from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
    item: {
        width: 500px;
    }
`;
export const Home = () => (
    <div>
        <Row>
            <Styles>
                <ListGroup horizontal>
                    <Col><ListGroup.Item className="list">PLĂȚI SECURIZATE</ListGroup.Item></Col>
                    <Col><ListGroup.Item className="list">LIVRARE ÎN 3 ORE</ListGroup.Item></Col>
                    <Col><ListGroup.Item className="list">100% DISCREȚIE ȘI GARANȚIE</ListGroup.Item></Col>
                    <Col><ListGroup.Item className="list">FELICITARE CADOU</ListGroup.Item></Col> 
                </ListGroup>
            </Styles>`
        </Row>
    </div>
)
